import React from 'react'
import './Tile.css'
import PropTypes from 'prop-types'
export default function Tile(props) {
    const className = ["tile",
        props.num % 2 === 0 && "white-tile", props.num % 2 !== 0 && "black-tile"
    ].filter(Boolean).join(' ');

    return (<div className={className}> {props.image != null && <div style={{ backgroundImage: `url(${props.image})` }} className="chess-piece"></div>} </div>)
}
Tile.propTypes = {
    num: PropTypes.number,
    image: PropTypes.string
}
